import React from "react";
import {Typography} from "@material-ui/core";
import {useQuery} from "@apollo/client";
import {text} from './queries'

export const Home = () => {
    const helloTxt = useQuery(text)
    return (
        <div>
            <Typography>{helloTxt}</Typography>
        </div>
    )
}
